import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import { Col, ListGroup, ListGroupItem, Button, Row } from "reactstrap";

import { getLoggedInUser } from "../../../helpers/authUtils";

class ServiceTypeList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      user: getLoggedInUser()
    };
  }

  render() {
    const { serviceTypes } = this.props;
    return (
      <Fragment>
        <Col lg={12}>
          <ListGroup>
            {serviceTypes &&
              serviceTypes.map((s, index) => {
                return (
                  <ListGroupItem key={index}>
                    <Row>
                      <Col lg={8} md={6} sm={12}>
                        <label>{s.name}</label>
                      </Col>
                      <Col lg={4} md={6} sm={12}>
                        <Button
                          color="danger"
                          onClick={() => this.props.deleteServiceType(s._id)}
                        >
                          Delete
                        </Button>
                        <Button color="primary">
                          <a href={`/service-types/${s._id}`}>Edit</a>
                        </Button>
                      </Col>
                    </Row>
                  </ListGroupItem>
                );
              })}
          </ListGroup>
        </Col>
      </Fragment>
    );
  }
}

export default connect()(ServiceTypeList);
